import React from 'react'
import SeasonCard from "./SeasonCard";
import Navbar from "../Navbar/Navbar";
import SeasonTab from "./SeasonTab";

class AllSeasonsList extends React.Component {
  render() {
    return(
      <div>
        <Navbar />
        <div className="container">
          <h3 className="indigo-text text-darken-4 darken">All Seasons</h3>
          <div className="divider"></div>
          <div className="row">
            <div className="col s12">
              <ul className="tabs">
                <SeasonTab Season_Id={1} />
                <SeasonTab Season_Id={2} />
                <SeasonTab Season_Id={3} />
                <SeasonTab Season_Id={4} />
                <SeasonTab Season_Id={5} />
                <SeasonTab Season_Id={6} />
                <SeasonTab Season_Id={6} />
              </ul>
            </div>
            <div id={`season${1}`} className="col s12">Test 1</div>
            <div id="season2" className="col s12">Test 2</div>
            <div id="season3" className="col s12">Test 3</div>
            <div id="season4" className="col s12">Test 4</div>
            <div id="season4" className="col s12">Test 4</div>
            <div id="season4" className="col s12">Test 4</div>
            <div id="season4" className="col s12">Test 4</div>
            <div id="season4" className="col s12">Test 4</div>
            <div id="season4" className="col s12">Test 4</div>

            {/*<div className="col m12 s12 allSeasonsList">*/}
            {/*  <SeasonCard Season_Id={1} Season_Winner={"Rajhasthan Royals"} Season_Runner_Up={"Chennai Super Kings"} />*/}
            {/*  <SeasonCard Season_Id={2} Season_Winner={"Rajhasthan Royals"} Season_Runner_Up={"Chennai Super Kings"}/>*/}
            {/*  <SeasonCard Season_Id={3} Season_Winner={"Rajhasthan Royals"} Season_Runner_Up={"Chennai Super Kings"}/>*/}
            {/*  <SeasonCard Season_Id={4} Season_Winner={"Rajhasthan Royals"} Season_Runner_Up={"Chennai Super Kings"}/>*/}
            {/*  <SeasonCard Season_Id={5} Season_Winner={"Rajhasthan Royals"} Season_Runner_Up={"Chennai Super Kings"}/>*/}
            {/*  <SeasonCard Season_Id={6} Season_Winner={"Rajhasthan Royals"} Season_Runner_Up={"Chennai Super Kings"}/>*/}
            {/*</div>*/}
          </div>
        </div>
      </div>
    )
  }
}
export default AllSeasonsList;
